import "./App.css";
import * as React from "react";
import Button from "@mui/joy/Button";
import Input from "@mui/joy/Input";
const App = () => {
  return (
    <div className="App">
      <h1>Split Expenses</h1>

      <Input placeholder="# of People" />
      <Button>CALCULATE</Button>
    </div>
  );
};

export default App;
